import React from "react";
import FormTodo from "./FormTodo";
import CheckBox from "./CheckBox";
import Tasks from "./Tasks";
const Container = () =>{
    return (
        <div className="App">
            Container!
            <FormTodo/>
            <CheckBox/>
            <Tasks/>
        </div>
    );
}

export default Container;
